function Home() {

  const navigate = useNavigate()


  useEffect(() => {
    const dataRegister = JSON.parse(localStorage.getItem("dataRegister"))
    if (!dataRegister) {
      navigate('register')
    }
  }, [])

  useEffect(() => {

  }, [])

  return <div>Home</div>
}

